            if(!tranzilation){
             tranz = `${tranz + codeArray[x]}`
        }  else{
            tranz = `${tranz + tranzilation.javaScript_code} `;
        }
        };
        res.status(200).json({message:tranz});
    }catch (e) {
        res.status(500).json(e.message);
    }
}

